import React from 'react';

const FilterBox = ({ onFilterChange }) => {
  const categories = ["Cameras", "Accessories", "Smartphones", "Clothing"];

  return (
    <div className="filter-box">
      <h2>Categories</h2>
      <ul>
        <li onClick={() => onFilterChange('')}>All Products</li>
        {categories.map((category, index) => (
          <li key={index} onClick={() => onFilterChange(category)}>
            {category}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default FilterBox;
